import React from 'react';
import { BarChart, Bar,  XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';
import { readRemoteFile } from 'react-papaparse';

readRemoteFile(
  './data/04.csv',
  {
    step: (results) => {
      console.log("Row data:", results.data)
    },
    complete: (results) => {
      console.log('Results:', results);
    }
  }
);


const data = [
  {
    name: 'A',
    uv: 4000,
    pv: 2400,
    amt: 2400,
  },
  {
    name: 'B',
    uv: 3000,
    pv: 1398,
    amt: 2210,
  },
  {
    name: 'C',
    uv: 2000,
    pv: 9800,
    amt: 2290,
  },
  {
    name: 'D',
    uv: 2780,
    pv: 3908,
    amt: 2000,
  },
  {
    name: 'E',
    uv: 1890,
    pv: 4800,
    amt: 2181,
  },
  {
    name: 'F',
    uv: 2390,
    pv: 3800,
    amt: 2500,
  },
  {
    name: 'G',
    uv: 3490,
    pv: 4300,
    amt: 2100,
  },
  {
    name: 'H',
    uv: 3490,
    pv: 4300,
    amt: 2100,
  },
  {
    name: 'I',
    uv: 3490,
    pv: 4300,
    amt: 2100,
  },
  {
    name: 'J',
    uv: 3490,
    pv: 4300,
    amt: 2100,
  },
];


const CovidInspection = (props) => {
  return(
    <div className="commentBox">
      <BarChart
        width={500}
        height={300}
        data={data}
        margin={{
          top: 20,
          right: 30,
          left: 20,
          bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="pv" stackId="a" fill="#8884d8" />
        <Bar dataKey="uv" stackId="a" fill="#82ca9d" />
      </BarChart>
    </div>
  );
};

export default CovidInspection;
